import React from 'react';


const AvailableItem = ({ name, category, price, available, onToggleImportant, onToggleDone, onDelete }) => {


    return (
        <span >
      <span className=""> {name}, {category}, {price}, {available} </span>

      <button type="button"
              className="btn-primary"
              onClick={onToggleImportant}> Rent </button>

      <button type="button"
              className="btn-danger"
              onClick={onDelete}> Delete </button>
    </span>
    );
};

export default AvailableItem;
